import { ListItemButton, styled } from "@mui/material";
import { Colors } from "../theme";


export const StyledListItemButton = styled(ListItemButton)(({isActive})=> ({
    display:"flex",
    alignItems:"center",
    backgroundColor: isActive ? Colors.primary : 'transparent',

}));
